import React from 'react';

const CharacterCard = (props) => {
  // console.log(props);
  return (
    <div id="character-card">
      <p>{props.studentData.name}</p>
      <button onClick={() => props.handleToggle(props.studentData)}>Toggle</button>
      <button>Edit</button>
    </div>
  )
}

export default CharacterCard;
